import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div style={{height:'2px',backgroundColor:'#82cff2', marginTop:'20px'}}></div>
        <div style={{height:'800px'}}></div>
        <div style={{height:'2px',backgroundColor:'#82cff2', marginBottom:'20px'}}></div>
      </div>
    );
  }
}

export default App;
